import React from "react";
import PlayerInfo from "./PlayerInfo";
import TeamInfo from "./TeamInfo";

function Search() {
  //   const [playersShown, setPlayersShown] = useState(true);
  //   function handleClick() {
  //     setPlayersShown((current) => !current);
  //   }

  return (
    <div>
      <ul className="flex">
        <li className="flex-auto basis-1/2 hover:underline-offset-auto">
          <input
            type="radio"
            name="answer"
            value="Players"
            id="answer_players"
            // onClick={handleClick}
          />
          <label for="answer_players">Players</label>
          <div className="absolute hidden">ha</div>
        </li>
        <li className="flex-auto basis-1/2 hover:underline-offset-auto">
          <input
            type="radio"
            name="answer"
            value="Teams"
            // onClick={handleClick}
          />
        </li>
      </ul>

      <ul class="grid grid-cols-2 gap-x-5 m-10 max-w-md mx-auto">
        <li class="relative">
          <input
            class="peer"
            type="radio"
            value="yes"
            name="answer"
            id="answer_yes"
          />
          <label
            class="flex p-5 bg-white border border-gray-300 rounded-lg cursor-pointer focus:outline-none hover:bg-gray-50 peer-checked:ring-green-500 peer-checked:ring-2 peer-checked:border-transparent"
            for="answer_yes"
          >
            Yes
          </label>

          <div class="absolute hidden w-5 h-5 peer-checked:block top-5 right-3"></div>
        </li>
        <li class="relative">
          <input
            class="sr-only peer"
            type="radio"
            value="no"
            name="answer"
            id="answer_no"
          />
          <label
            class="flex p-5 bg-white border border-gray-300 rounded-lg cursor-pointer focus:outline-none hover:bg-gray-50 peer-checked:ring-red-500 peer-checked:ring-2 peer-checked:border-transparent"
            for="answer_no"
          >
            No
          </label>

          <div class="absolute hidden w-5 h-5 peer-checked:block top-5 right-3"></div>
        </li>
      </ul>
    </div>
  );
}

export default Search;
